import "./navbar.styles.scss";

import React from "react";

function Navbar() {
  return (
    <div className="nav-container">
      <div>LOGO</div>
      <div className="dropdown">
        <p>I want to...</p>
        <svg
          xmlns="http://www.w3.org/2000/svg"
          className="down-icon"
          fill="none"
          viewBox="0 0 24 24"
          stroke="currentColor"
          strokeWidth={2}
        >
          <path
            strokeLinecap="round"
            strokeLinejoin="round"
            d="M19 9l-7 7-7-7"
          />
        </svg>
      </div>
    </div>
  );
}

export default Navbar;
